import logo from './logo.svg';
import './App.css';
import Kim from '../src/day01/d01MyComponent';
import Test from './day02/d01export';
import Inline from './day02/d03illine';
import CssFile from './day02/d04cssfile';
import './day02/d05cssfile.css';
import EmotionComponent from '../src/day03/do1emotion';
import RouterPage from './day03/d02router';
import {
  BrowserRouter,
  Route,
  RouterProvider,
  Routes,
  createBrowserRouter,
} from 'react-router-dom';
import ErrorPage from './day03/d03err';
import DashboardPage from './dashboard/dashboard';
import ConditionalPage from './day05/01conditional';
import StagePage from './day06/d01state';
import MapPage from './day07/d01map';
import UseEffectPage from './day08/d01useEffect';

let router = createBrowserRouter([
  { path: '/abc', element: <EmotionComponent /> },
  { path: '/bbb', element: <RouterPage /> },
  { path: '/dashboard', element: <DashboardPage /> },
  { path: '/', element: <ConditionalPage /> },
  { path: '/state', element: <StagePage /> },
  { path: '/useEffectPage', element: <UseEffectPage /> },
]);

const App = () => {
  return <RouterProvider router={router} />;
};

